import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';


class Contact extends Component {
    render() {
        return(
           <div className="contact-body">
               <Grid className="contact-grid">

                   <Cell col={6}>
                       <h2>Miguel J Jimenez</h2>
                       <img alt="miguel jimenez"
                       src="https://avatars2.githubusercontent.com/u/67612142?s=460&u=192b95aeb38edd7f6b27e5a15dd9c1f630901163&v=4"
                       style={{height: "250px"}}
                       />
                       <p style={{width: "75%", margin:"auto",paddingTop:"1em"}}>
                           Miguel J Jimenez is a web developer based out of New Jersey. Some of his passions outside of web development include traveling, motorcyles, live music, and crafting complex cocktails.</p>

                   </Cell>
                   <Cell col={6}>text here</Cell>




               </Grid>
           </div>
        )
    }
}

export default Contact;
